if mibBuilder.loadTexts: hpnicfSysReloadAction.setDescription(" Writing reloadOnSchedule(2) to this object performs the reload operation on schedule. If hpnicfSysReloadScheduleTime is not set, the value of hpnicfSysReloadAction can't be set to 'reloadOnSchedule(2)'. Writing reloadAtOnce(3)to this object performs the reload operation at once, regardless of the hpnicfSysReloadScheduleTime. When reloadCancel(4)is set, the scheduled reload action will be cancelled and the value of hpnicfSysReloadAction will be 'reloadUnavailable(1)',the value of hpnicfSysReloadSchedule will be 0, hpnicfSysReloadTag will be given a value of zero length, but the content of hpnicfSysReloadScheduleTable will remain. The hpnicfSysReloadSchedule and hpnicfSysReloadTag determine the reload entity(ies) in mutually exclusive way. And the hpnicfSysReloadSchedule will be handled at first. If the value of hpnicfSysReloadSchedule is invalid, then the hpnicfSysReloadTag will be handled. If the value of hpnicfSysReloadSchedule is valid, the value of hpnicfSysReloadTag is ignored and a reload action will be implemented to the entity specified by hpnicfSysReloadEntity in the entry pointed by hpnicfSysReloadSchedule. If hpnicfSysReloadSchedule is valid, but the entry hpnicfSysReloadSchedule pointing to is not active, the reload action will be ignored , and an inconsistent value will be returned. If multiple entities are required to be reloaded at the same time, the value of hpnicfSysReloadTag must be specified to select the reload parameters in the hpnicfSysReloadSceduelTable, and hpnicfSysReloadSchedule must have the value of '0'. If the whole fabric is to be reloaded in an XRN device, all the units in the fabric must have at least one entry in the hpnicfSysReloadSceduelTable with the same tag in hpnicfSysReloadSceduelTagList. When a reload action is done, or there is no reload action, the value should be reloadUnavailable(1). ")
